Sometimes you need to create a type that specifies the function itself, instead of just its parameters or its return type. For example, you might want to say that f is a function that takes two strings and returns a string. You can achieve this with a function type expression : let f: (x: string, y: string) => string; The parameter names are required here, if you write (string, string) => string then TypeScript will think that you have a function with two parameters named string of type any. This syntax is very useful for typing higher-order functions: function getGreeting(name: string, greeter: (name: string) => string) { return greeter(name);
} const myName = 'John Doe';
const greeter = (name: string) => `Hello ${name}`; console.log(getGreeting(myName, greeter)); One interesting consequence of the way TypeScript inference works, is that parameters of anonymous functions can often be inferred. Let's change this example and make an anonymous function out of greeter: function getGreeting(name: string, greeter: (name: string) => string) { return greeter(name);
} const myName = 'John Doe'; console.log(getGreeting(myName, (name) => `Hello ${name}`)); Note how we no longer need to type name in the anonymous function - TypeScript has automatically inferred it to be of type string.

107.body:
A literal type is a type whose only value is a literal. Here is how we could define a literal type "Todo": type TodoType = 'Todo'; Here is how we can use it: let todo: TodoType = 'Todo'; Note that we can't assign any other value to todo including other strings. For example this is not possible: let todo: TodoType = 'Done'; We could also skip declaring the type alias and just use the literal type directly: let todo: 'Todo' = 'Todo'; It should be noted that if we declare a variable, then by default TypeScript will infer it as a string. This makes sense since we could change the variable later: let todo = 'Todo';
// Without the explicit type annotation, todo is a string However if we declare a constant, then by default TypeScript will infer a literal type. This also makes sense since we can't change the constant later: const todo = 'Todo';
// Even without the explicit type annotation,
// todo now has the literal type 'Todo' While literal types by themselves are not very helpful, they are extremely useful in the context of union types.

108.body:
A union type is a type that represents a value which may be one of multiple values. Consider the type TaskState which represents one of the following states: Todo InProgress Done Here is how we would defined the TaskState type: type TaskState = 'Todo' | 'InProgress' | 'Done'; The TaskState type is a union type and each of the literal types 'Todo', 'InProgress' and 'Done' is a member of the union. A variable of type TaskState can only be of one of these literal types, i.e. it can only have one of the respective values. For example these are all valid: const state: TaskState = 'Todo';
const state2: TaskState = 'InProgress';
const state3: TaskState = 'Done'; But this is not: const invalidState: TaskState = 'Dropped';

110.body:
It should be clear by now how we can define a union type, but how can we work with a union type? Consider the following function: function logTaskName(taskName: string | undefined) { console.log({ taskName, taskNameLength: taskName.length, });
} Compiling this example will result in the following error: index.ts:4:21 - error TS18048: 'taskName' is possibly 'undefined'.
4 taskNameLength: taskName.length, ~~~~~~~~
Found 1 error in index.ts:4 TypeScript will only allow to do something with the value of a union type if that something is valid for every member of the union. Since taskName can be either a string or undefined, we can't call .length on it, because .length is not a valid property of undefined! Instead we need to narrow the type with code. Basically, TypeScript can look at our code and try to understand that in certain code parts a value of a union type can only have the type of a particular member of the union. The simplest way of narrowing a type is equality narrowing . Here we can use the === or !== operators to narrow a type. Consider this example: function logTaskName(taskName: string | undefined) { if (taskName !== undefined) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} We narrow the type of taskName in the taskName !== undefined branch. TypeScript will inspect our code and realize that since taskName had the string | undefined type and taskName !== undefined in the truthy branch of the if statement, taskName must be of type string inside that branch (there is simply no other way). Similarly, in the falsy branch of the if statement (i.e. the else branch), TypeScript will know that taskName must be undefined. This example also showcases a very important concept: The same variable can have a different type depending on the part of the code we are. This is not the case in many other programming languages, where a variable will always have the same type once it has been initialized. Another (similar) way of narrowing a type is truthiness narrowing . Here we use the fact that certain values are truthy or falsy to narrow a type. Consider this example: function logTaskName(taskName: string | undefined | null) { if (taskName) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} Since undefined and null are both falsy, the taskName in the truthy branch of the if statement can only have the type string and we can use the .length property. However truthiness narrowing can lead to bugs and indeed the function logTaskName has a subtle error. Can you spot it? That's right - it doesn't correctly handle the case of the empty string - after all, the empty string '' is also falsy, therefore logTaskName("") would print that the task not defined, which is probably not what we were going for. We could fix the function like this: function logTaskName(taskName: string | undefined | null) { if (taskName === '') { console.log('the task is empty'); } else if (taskName) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} The last way of narrowing a type that we will discuss here is typeof narrowing. TypeScript knows how the typeof operator works and you can use it to narrow a type as you would expect: function processInput(value: string | number): number { if (typeof value === 'string') { // value must be a string here return value.length; } else { // value must be a number here return value; }
}

112.body:
We can write user-defined type guards by utilizing type predicates . Consider the following example: const array = ['Hello', undefined, 'World', undefined];
const filteredArray = array.filter((val) => val !== undefined); Here array is a (string | undefined)[] and filteredArray removes the undefined elements. However the inferred type of filteredArray would still be (string | undefined)[] because TypeScript can't easily inspect the contents of the filter function to realize that we remove the undefined elements. We could theoretically use a type assertion here: const array = ['Hello', undefined, 'World', undefined];
const filteredArray = array.filter((val) => val !== undefined) as string[]; However instead of yelling at the TypeScript compiler to shut up, we can choose a better way and write a user-defined type guard: function isDefined(val: string | undefined): val is string { return val !== undefined;
} The isDefined function is a type guard, because it's return type is the type predicate val is string. Generally, a type predicate must have the form parameter is Type where parameter is the name of a parameter from the function signature. We can use the type guard like this: const array = ['Hello', undefined, 'World', undefined];
const filteredArray = array.filter(isDefined); Now the inferred type of filteredArray will be string[] - and all that without using a single type assertion. Hooray!

113.body:
A particularly important union type is the discriminated union . This is a union where a property is used to discriminate between union members. Consider the following classical example: type Square = { kind: 'square'; size: number;
}; type Rectangle = { kind: 'rectangle'; width: number; height: number;
}; type Shape = Square | Rectangle; We can now narrow values of the discriminated union based on the discriminant property (which in this case is kind): function getArea(shape: Shape) { if (shape.kind === 'square') { // Here shape must be of type Square return shape.size * shape.size; } else { // Here shape must be of type Rectangle return shape.width * shape.height; }
}

115.body:
Generics allow us to write code that is type-safe, yet independent of specific types. Consider the example of retrieving the first element of an array: function getFirstElement(arr) { return arr[0];
} How would we type this? We could use any: function getFirstElement(arr: any): any { return arr[0];
} However using any is - as we already mentioned - a bad idea since we lose all the type information even if we pass in an array of a known type. For example all these constants would be inferred to have type any: const num = getFirstElement([1, 2, 3]);
const str = getFirstElement(['a', 'b', 'c']); We could also make use of function overloads and write something like this: function getFirstElement(arr: number[]): number;
function getFirstElement(arr: string[]): string;
function getFirstElement(arr: undefined[]): undefined;
// More overloads and implementation here But this obviously gets very tedious and error-prone for most cases. Instead TypeScript allows us to use generics to specify that some code does not depend on the concrete types and only cares about the relation between certain types.

116.body:
Consider the identity function that simply takes an argument arg and returns it unchanged. We can use a type variable Type and type it like this: function identity<Type>(arg: Type): Type { return arg;
} This basically says that the identity function takes an argument of type Type and that its return type is of the same type as the argument. Now we get proper type inference: let val = 'Hello, world!';
let val2 = identity<string>(val); // val2 is of type string We dont actually have to manually specify the type string when calling the function and can instead rely on TypeScripts inference: let val = 'Hello, world!';
let val2 = identity(val); // val2 is of type string There is no single convention for naming type parameters. Common names includew T, Type and TType. Similarly, we can type the getFirstElement function: function getFirstElement<Type>(arr: Type): Type { return arr[0];
} const num = getFirstElement([1, 2, 3]);
const str = getFirstElement(['a', 'b', 'c']); Unlike in the getFirstElement that was typed using any, we now get meaningful type inference. For example num will have the type number (instead of any) and str will have the type string. You can use any number of type parameters you want. For example here is how we could write a correctly annotated map function: function map<In, Out>(array: In[], f: (value: In) => Out): Out[] { return array.map(f);
}

117.body:
Just like with functions, we can use type parameters with objects: type Box<Type> = { content: Type;
}; Now we can use the Box type with any type: // box has the type Box<number>
const box = { content: 0,
}; // box2 has the type Box<string>
const box2 = { content: 'Hello, world!',
}; We can also use generic functions and objects together: function extractContent<Type>(box: Box<Type>): Type { return box.content;
}

118.body:
Generic object types are often useful for collections (and containers), since collection logic is often independent of the specific item types. For example, retrieving the first element of an array or finding an element of a set by value using the === operator will be the same regardless of the types of the array or set elements. You already learned about generic arrays (note that you can use Array<T> in place of T[]). If you have an object type where the property keys have a certain known type and the property values have a certain known type, you can use the generic type Record<Key, Value> const ScoreRecord: Record<string, number> = { Alice: 50, Bob: 60, Charlie: 70,
}; Two other generic data structures that you know about are sets and maps: const mySet: Set<number> = new Set([1, 2, 3]);
const myMap: Map<string, number> = new Map([ ['Item 1', 1], ['Item 2', 2],
]); One other very important generic type is the Promise<Type> type which can be used to annotate asynchronous functions. For example, if we have an asynchronous function f that returns a promise with a string, we would annotate it like this: async function f(): Promise<string> { // Implementation here
}

119.body:
Often, we don't want to pass completely arbitrary type parameters. Consider this example: function printLength<Type>(arg: Type): number { return arg.length;
} This will throw the following error: index.ts:2:14 - error TS2339: Property 'length' does not exist on type 'Type'.
2 return arg.length; ~~~~~~
Found 1 error in index.ts:2 This makes sense since arg can be of literally any type and there is no guarantee that arg will actually have the property length. To change this, we need to constrain the type Type and make sure that arg must have the length property: function printLength<Type extends { length: number }>(arg: Type): number { return arg.length;
} As usual, we can use a type alias here: type HasLength = { length: number;
}; function printLength<Type extends HasLength>(arg: Type): number { return arg.length;
}

121.body:
We already learned how to create and run individual TypeScript files. However, as with JavaScript, we will usually be working with larger projects. Let's create a JavaScript project and add TypeScript support to it. First, we create a directory where our project will reside: mkdir example
cd example Next we need to create the package.json file to indicate that this directory should be a JavaScript project: pnpm init This will create a package.json file containing the project settings: { "name": "example", "version": "1.0.0", "description": "", "main": "index.js", "scripts": { "test": "echo \"Error: no test specified\" && exit 1" }, "keywords": [], "author": "", "license": "ISC"
} Next let's create a tsconfig.json to indicate that this particular project will use TypeScript: { "compilerOptions": { "strict": true }
} Setting the strict option in compilerOptions is equivalent to running tsc with the --strict flag. We will talk about this option in some more detail later. We could have also created the tsconfig.json file by running tsc --init, however this will add a lot of options that we really don't care about at the moment. Now let us create an index.ts file: function getGreeting(name: string): string { return `Hello, ${name}!`;
} console.log(getGreeting('World')); Finally we can compile the code: tsc This will create approximately the following index.js file: 'use strict';
function getGreeting(name) { return 'Hello, '.concat(name, '!');
}
console.log(getGreeting('World')); We can execute this file the same way we would execute any other JavaScript file: node index.js There is one small modification we need to make to this process. While using the globally installed TypeScript compiler is fine if you have a single project, you often might need to work on multiple projects at the same time. Since these projects might use different TypeScript versions, we usually want to install tsc on a per-project basis. Let's therefore install tsc as a dev (development) dependency (since we will not need it in the final code output): pnpm add --save-dev typescript This will install TypeScript only for this particular project. We can now run the tsc that was installed for this project using the following command: pnpm tsc

123.body:
Sometimes you want to include or exclude certain files from being processed by the TypeScript compiler. To accomplish this, you can specify the include or exclude parameters in the tsconfig.json. The include option takes an array of filenames or patterns to include in the program (relative to the directory containing the tsconfig.json file). For example we could include all files in src directory by setting include to ["src/**/*"]. The src/**/* notation is a so called glob pattern. Here * matches zero or more characters (excluding directory separators) and **/ matches any directory (with arbitrary nesting). Thefore src/**/* means "match any file in the directory src and all its subdirectories (no matter how deeply nested)". Note that by default include is set to ["**/*"] (i.e. match all files including arbitrarily nested subdirectories). The exclude parameter specifies an array of filenames or patterns that should be skipped when resolving include. It is important to note that the exclude parameter does not necessarily exclude the file from your codebase - a file specified by exclude can still become part of your codebase if you import it somewhere. The exclude parameter only changes which files are found by the include option finds. Consider the following example. Let's say that you have a bunch of *.test.ts files containing tests, like the following greet.test.ts: import { getGreeting } from './greet'; function testGreeting() { if (getGreeting('World') !== 'Hello, World!') { throw new Error('Test failed'); }
} This is not how we would really write a test, but that is irrelevant for now. If we would run pnpm tsc right now, we would see the we have greet.test.js in the output which is probably not desirable, since the tests probably shouldn't be part of the final compilation output. Therefore we could write the following tsconfig.json: { "include": ["src/**/*"], "exclude": ["src/**/*.test.ts"], "compilerOptions": { "strict": true, "outDir": "./dist" }
} If we delete the dist directory and run pnpm tsc again, greet.test.js is no longer present.

124.body:
There a lot of compiler options that we can set in the compilerOptions section of tsconfig.json besides strict and outDir. Let's discuss some of them. The strict Option The strict option enables a wide range of - well - strict type checking. Here is some example code that contains a few type issues: function getNumber(): number | undefined { return Math.random() > 0.5 ? 0 : undefined;
} function logNumber(n: number) { console.log(n);
} function logAny(x) { console.log(x);
} const number = getNumber();
logNumber(number);
logAny(number); If we set strict to false (which it is by default), this code will (surprisingly) compile. However if we turn strict on, we get the errors that you would expect from what you learned in the previous sections of the TypeScript chapter: src/index.ts:9:17 - error TS7006: Parameter 'x' implicitly has an 'any' type. 9 function logAny(x) { ~ src/index.ts:14:11 - error TS2345: Argument of type 'number | undefined' is not assignable to parameter of type 'number'. Type 'undefined' is not assignable to type 'number'. 14 logNumber(number); ~~~~~~ Found 2 errors in the same file, starting at: src/index.ts:9 You should always turn strict on, unless you have a really good reason not to (for example because you are migrating from a JavaScript or a very old TypeScript codebase). The target Option Remember how we talked about downleveling in the first section of this chapter? The target options changes which JS features are downleveled and which are left as is. For example if target is es5 template strings will be downleveled, but if it is es2015 (equivalent to es6) they won't be, because template strings were introduced in ES2015. Take this code: const world = 'World';
console.log(`Hello ${world}`); If target is set to es5, it would compile to this: 'use strict';
var world = 'World';
console.log('Hello '.concat(world)); If target is set to es2015, the compilation output would look like this: 'use strict';
const world = 'World';
console.log(`Hello ${world}`); This is because with target set to es5 the template string had to be downleveled. Some valid targets are: es5 es2015 (equivalent to es6) es2016 up to es2022 There is also the esnext target which refers to the highest version of TypeScript. This target should be used with caution since it means different things between different TypeScript versions. Modern browsers support all es6 features, so es6 is often a good choice. You might choose to set a lower target though if your code is deployed to older environments. Alternatively you might choose a higher target if your code is guaranteed to run in newer environments. The lib Option The lib option allows you specify libraries to be included in the compilation. Basically, you can use this to let TypeScript know which APIs will be available in the runtime environment. For example let's say we have this code which would only work in the browser since it attaches an event listener to the browser document: document.addEventListener('DOMContentLoaded', () => { console.log('DOM has loaded');
}); If we only have lib equal to ["es2015"], we will get a bunch of compilation errors: src/index.ts:1:1 - error TS2584: Cannot find name 'document'. Do you need to change your target library? Try changing the 'lib' compiler option to include 'dom'. 1 document.addEventListener('DOMContentLoaded', () => { ~~~~~~~~ src/index.ts:2:5 - error TS2584: Cannot find name 'console'. Do you need to change your target library? Try changing the 'lib' compiler option to include 'dom'. 2 console.log("DOM has loaded"); ~~~~~~~ Found 2 errors in the same file, starting at: src/index.ts:1 But if we set lib to ["es2015", "dom"] the compilation errors go away since TypeScript know introduces the DOM types into the compilation process. The noEmit Option The noEmit option can be set to true to not produce JavaScript output. This makes room for another tool to convert the TypeScript files to something that can be run inside a JavaScript environment. This is often done when we only want to use TypeScript as a type checker (as is common in projects) or to provide suggestions in your coding editor.

126.body:
The extends option can be used to inherit from another configuration file. For example we might have a base.json configuration file like this: { "compilerOptions": { "strict": true }
} Now the tsconfig.json could extend this file: { "extends": "base.json", "include": ["src/**/*.ts"], "compilerOptions": { "noEmit": true }
} The resulting configuration would be strict and not emit JavaScript files. This feature is particularly useful because it allows someone to write a TypeScript configuration file that specifies the settings that should be applied to TypeScript codebases in a company/project and then everyone can simply extend this configuration file.

