Everything that is after a double slash on a line in JavaScript is a comment . Comments are ignored by the runtime and therefore have no effect for the execution of your program: // This is just a comment
// Comments have no effect
console.log('Hello, world!');
// Therefore this program is equivalent to the
// program from the previous chapter We will heavily utilize comments throughout this book inside the code blocks to highlight important ideas. There is a lot of discussion on how much you should comment your programs. We will return to this when discussing functions. However one rule is that if your code is so terrible that it requires extensive commentary to explain its behavior or purpose, you should fix the code. Just like a work of art, your code should stand on it's own merits. Imagine commenting a work of art (oh, wait)... However it is better to have terrible code and comments than have terrible code and no comments. We will also adopt the convention that if a comment is next to a line with a console.log statement, that comment shows the output that would be logged to the console if the code was run. For example: console.log('Hello, world!'); // Hello, world! This is the point where we tell you that while you are reading this book you should absolutely follow along in some runtime (probably Node.js, but a browser is fine too). This is very important . Go ahead and open a Node.js console now . Come on, we'll wait... ... ... ... Finally . Let's move on.

