We could use the built-in HTTP module of Node.js, but this is not terribly convenient. Instead we will use an extremely popular framework called Express . While Express builds on top of the HTTP module, it provides a lot of additional useful functionality. Create a new Node.js project inside some directory: pnpm init Install Express: pnpm add express Now create a file named app.js inside the directory. As usual the name of the file is up to you, but it should be something meaningful. In the file we will create an Express application and then make that application listen for connections on a specified host and port. This is how you can create an Express application and make it listen on port 3000: const express = require('express');
const app = express();
const PORT = 3000; app.listen(PORT, () => { console.log(`Server listening on port ${PORT}...`);
}); This application is not very useful, so let's add a route to it. Add this above the call to listen: app.get('/', (req, res) => { res.send('Hello, world!');
}); Start the application: node app.js If you open a browser and navigate to http://localhost:3000 you will see Hello, world! You can also use cURL, which includes a command-line tool for transferring data on a network. Among other things it supports HTTP and is available on both Windows and most Linux distributions. Open a command line and run: curl http://localhost:3000/ The will output the following: Hello, world!

136.body:
HTTP knows multiple request methods . We primarily care about two request methods for now - namely GET and POST . GET requests are generally used to retrieve data. Recall out route from above: app.get('/', (req, res) => { res.send('Hello world!');
}); This indicates that if a GET request is sent to the path '/', we would like to return 'Hello, world!' to the client. The req variable represents the request object and res represents the respose object . If we want to send a HTTP response to the client we therefore use res.send. POST requests are generally used to send information to the server that tell it to create a new resource or update an existing resource. For example a login request will generally be a POST request since it tells the server that a user has logged in to the application. Similarly, if you submit a web form, there will usually be a POST request attached to that, since form submissions carry new information. With POST requests, we are more interested in telling the server that something happened than in the data the server returns to us. POST requests usually need to send much more information to the server than GET requests. Therefore, POST requests can have a request body which allows us to carry this additional data when sending a request. Let's have a look at an example. Note that we need to enable some middleware (we will return to the concept of middleware later): app.use(express.text()); Consider the following route which simply returns the request body back to the client: app.post('/post-example', (req, res) => { res.send(req.body);
}); How do we test this? You cannot simply send a POST request in a browser the way you would send a GET request. This is where curl comes in really handy. We need to specify that we want to send a POST request using the -X flag. In addition we specify the data that we want to send in the body of the POST request using the -d flag. Finally we specify a header called Content-Type and set it to text/plain. This indicates that the data we want to send is plain text. The final command looks like this: curl -X POST -H "Content-Type: text/plain" -d 'haha' http://localhost:3000/post-example Generally speaking GET requests transmit information using the querystring, while POST requests transmit information in the request body. Note that we will rarely send plain text in the request. Instead we will use a special format called JSON. This is a file format that supports a bunch of primitive values, arrays and dictionaries. A typical JSON object could look like this: { "tasks": ["Task 1", "Task 2", "Task 3"], "date": { "year": 2022, "month": 06, "date": 18 }
} In order to accept JSON requests, we need to replace the express.text middleware with the express.json middleware: app.use(express.json()); Now we can curl the same path like this: curl -X POST -H "Content-Type: application/json" -d '{ "key": "value" }' http://localhost:3000/post-example Note that here we specify the application/json content type. This is all fine and dandy, but how do client and server know how to interpret all these things? The answer to that question is the IETF (short for Internet Engineering Task Force). This is an organization that sets standards for the Internet (hence the name). Among other things it is responsible for creating the various RFCs (Request for Comments) that outline the workings of HTTP. For example HTTP 1.1 (which is the most common HTTP version you will encounter at the time of this writing) is outlined in RFCs 7230-7235. URIs on the other hand are outlined in RFC 3986. We encourage you to have a quick look at the respective RFCs. You should definitely not read them all at this stage, but just understand the sheer complexity of the things we are discussing here. We are really just scratching a very tiny part of the surface of it all. Lucky for you, most of the RFCs will probably not be terribly relevant in your day-to-day life.

