Whenever we write programs, we need to manipulate data. This data needs to be stored somewhere and we need to be able to access it somehow. We also need to deal with the fact that when we execute a program, the values we deal with are not predictable in advance. For example we don't know which tasks a user might create (that is kind of the point of writing our application). Nevertheless, we must be able to access created tasks through a predictable name like tasks or createdTasks. Therefore we need a way to put an unpredictable value in a "box" somewhere and refer to it using a predictable name. In programming, this box is referred to as storage and the predictable name as a symbolic name . A variable is just that - a storage location containing a value which is referred to by a symbolic name. This sounds really fancy, but it just means that there is a value somewhere in your storage and you can refer to that value using a symbolic name that doesn't change (even if the value itself changes). For example you could have a variable age which has the value 20 (we say that age is equal to 20): Now even if the value of age changes (e.g. to 21 because a birthday happened), the variable name doesn't change, only the value does. The variable name will still be age, however now age will have the value 21 (i.e. age will be equal to 21): JavaScript lets you declare variables with the let keyword. You can assign values to variables using the assignment operator (=): // Declare a variable
let x; // Assign a value to a variable
x = 10; You can print the value of the variable using the console.log method: console.log(x); // 10 If you follow along in the Node.js (or browser) console, you don't actually need to use the console.log method to print the value of a variable. Instead you can simply type the variable (or any expression for that matter) and the console will display its value. You can also have a declaration and an assignment on a single line. In fact, this is usually the way to go: let y = 10; The value of a variable may change over the course of a program: let y = 10;
console.log(y); // 10 // Assign a new value to the variable
y = 20;
console.log(y); // 20 This will log 10 and then 20 to the console. If you want to declare a predictable name for a value that never changes, you can declare a constant . This is done using the const keyword: const ten = 10; If you try to reassign a value to a constant, you get an error. For example if you do const ten = 10;
ten = 20; you get Uncaught TypeError: Assignment to constant variable. You will almost exclusively see us using const instead of let from now on. Reassignment is not nearly as necessary as you might think right now. You can also declare variables using the var keyword. We will not cover it here and you essentially only need to know one thing about var - you should basically never use it . It's mostly a historical artifact of the language at this point. Any variable has a data type which denotes the range of values it can take and which operations can be performed on the variable. You can use the typeof operator to obtain the data type of a variable. We begin with a few particularly important primitive data types . Let's talk about numbers, booleans, strings and undefined.

16.body:
You've already encountered the Number data type: const age = 20;
console.log(typeof age); // number Any integer or real number is a Number: console.log(typeof 42); // number
console.log(typeof -20); // number
console.log(typeof 3.4); // number
console.log(typeof -1.7); // number You can perform arithmetic on numbers using the usual arithmetic operators +, -, * and /. There is also the % (modulo) operator which returns the remainder of a division. Finally, there is the ** operator which does exponentiation: const a = 3;
const b = 4;
console.log(a + b); // 7
console.log(a - b); // -1
console.log(a * b); // 12
console.log(a / b); // 0.75
console.log(a % b); // 3
console.log(a ** b); // 81 You can also use the shorthand assignment operators to combine asssignment and arithmetic operators: let a = 3;
a += 4;
console.log(a); // 7
a -= 2;
console.log(a); // 5
a *= 3;
console.log(a); // 15
a /= 3;
console.log(a); // 5
a %= 3;
console.log(a); // 2
a **= 5;
console.log(a); // 32 You also use the postfix increment and the postfix decrement operators to increment or decrement a value by 1: let a = 4;
a++;
console.log(a); // 5
a--;
console.log(a); // 4 So far, so obvious. However there are also some other things which have type Number like Infinity. Infinity is a special value that represents mathematical infinity: console.log(typeof Infinity); // number Additionally there is a special value called NaN (short for "not a number"). For example the result of 0 / 0 is NaN: console.log(0 / 0); // NaN Hilariously enough, NaN itself is a number. This is despite the fact that its name literally says that it isn't: console.log(typeof NaN); // number Don't let that confuse you. Another important thing about numbers is that you need to be careful when you are trying to perform operations with real numbers. For example if you add 0.1 and 0.2 you get a weird result: console.log(0.1 + 0.2); // 0.30000000000000004 This is not the fault of JavaScript, but instead has to do with the limitations of trying to represent real numbers in binary on a finite hardware. We will not go into great detail in this book about this problem. If you're interested in more details we encourage you to have a look at the IEEE754 standard.

160.body:
Whenever you write applications which have a lot of logic in the client, you will need to manipulate the DOM (i.e. add, remove, change or retrieve elements). This can be done by using JavaScript functions that exist on the document object, which is is a global variable that refers to the currently rendered DOM tree. For the rest of this section, we will consider the following document: <!doctype html>
<html lang="en"> <head> <meta charset="utf-8" /> <title>Easy Opus</title> </head> <body> <div id="app"> <h1>My tasks</h1> <div id="taskList"> <p id="firstParagraph" class="task"> Read the Next.js book </p> <p id="secondParagraph" class="task"> Write a website </p> </div> </div> </body>
</html> If you want to follow along, you can open this document in a browser, open the JavaScript console and then write the code in the console. First let's talk about how to retrieve elements. The document.getElementById(id) function allows you to select an element by its unique ID: const paragraph = document.getElementById('firstParagraph');
console.log(paragraph); // <p id="firstParagraph" class="task"> Note that paragraph is just a regular JavaScript object. For example, you could access various properties like the element ID and class or the HTML markup contained within the element: console.log(paragraph.id); // firstParagraph
console.log(paragraph.className); // task
console.log(paragraph.innerHTML); // Read the Next.js book We can also get all the elements that have a certain class using document.getElementsByClassName(className): const tasks = document.getElementsByClassName('task');
console.log(tasks); // HTMLCollection { 0: p#firstParagraph.task, 1: p#secondParagraph.task, length: 2, … } Note that tasks is an HTMLCollection which is an array-like object. This means that it behaves similar to an array (for example you can index it), but doesn't have most of the array methods we learned in the first chapter: console.log(tasks.length); // 2
console.log(tasks[0]); // <p id="firstParagraph" class="task"> // This will throw a TypeError: tasks.map is not a function
const ids = tasks.map((task) => task.id); You can also retrieve all elements with a certain tag by using document.getElementsByTagName(tagName). Consider this example: const paragraphs = document.getElementsByTagName('p');
console.log(paragraphs); // HTMLCollection { 0: p#firstParagraph.task, 1: p#secondParagraph.task, length: 2, … } Note how this is again an HTMLCollection. The two most important and modern JavaScript methods for element retrieval are document.querySelector(selector) and document.querySelectorAll(selector) which returns the first and all elements that match a certain CSS selector respectively. Here is how we could use these methods to accomplish our tasks from before: // The hash (#) indicates an ID selector
const paragraph = document.querySelector('#firstParagraph');
// The period (.) indicates a class selector
const tasks = document.querySelectorAll('.task');
const paragraphs = document.querySelectorAll('p'); Note that this time tasks will be a NodeList (instead of an HTMLCollection). However it is still an array-like object that you can index with []. JavaScript also allows us to create elements and append them to other elements. You can create elements using document.createElement(tagName). This is how you could create a paragraph with an ID, a class and some text: const element = document.createElement('p');
element.id = 'thirdParagraph';
element.classList.add('task');
element.innerHTML = 'New task'; You can append an element as a last child of a parent element using parentElement.appendChild(childElement). For example to append the newly created element to another element taskList you would write this: // Retrieve the taskList element
const taskList = document.querySelector('#taskList'); // Append element to taskList
taskList.appendChild(element); Let's put all of this together and add a button to our page that allows us to add a new task. This is the JavaScript that we would like to execute if the button is clicked: const paragraph = document.createElement('p');
paragraph.id = 'thirdParagraph';
paragraph.classList.add('task');
paragraph.innerHTML = 'New task';
const taskList = document.querySelector('#taskList');
taskList.appendChild(paragraph); We would now have to add a button element and execute this code whenever the button is clicked by registering a click event listener on the button: <!doctype html>
<html lang="en"> <head> <meta charset="utf-8" /> <title>Easy Opus</title> <script> function addTask() { const paragraph = document.createElement('p'); paragraph.id = 'thirdParagraph'; paragraph.classList.add('task'); paragraph.innerHTML = 'New task'; const taskList = document.querySelector('#taskList'); taskList.appendChild(paragraph); } </script> </head> <body> <div id="taskList"> <button id="addTask" onclick="addTask()">Add a task</button> </div> </body>
</html> Note that if we want this code to work correctly when clicking the button multiple times, we should change the ID on each button click. Try doing this by yourself.

