If you click the button right now, the page will refresh, the URL will change and your inputs will be cleared. This is the default behaviour of a form submission, however we often want to intercept and modify this. To achieve this, let's add an event listener to the form that will listen for submit events. This can be done via the addEventListener function which takes two arguments. The first argument is the event to listen to (which is 'submit' in this case). The second argument is a function that takes the specific event and handles it. The addEventListener is a typical example of a higher-order function since it takes a function as one of its arguments. We will just log the currentTarget of the event for now. This property identifies the element to which the event handler has been attached (in this case it's the form). const contactForm = document.getElementById('contact');
contactForm.addEventListener('submit', function (event) { // Prevent default form submission behaviour event.preventDefault(); console.log({ currentTarget: event.currentTarget });
}); Note how the event.currentTarget object contains our inputs (among other properties).

