Next, we need to add an event listener to taskForm. The event.currentTarget will have the property elements which contains taskInput whose property value contains our input: taskForm.addEventListener('submit', function (event) { // Prevent default form submission event.preventDefault(); console.log({ inputValue: event.currentTarget.taskInput.value });
}); This should log the input. Lets now store it in a variable and use trim to remove whitespace from both ends: taskForm.addEventListener('submit', function (event) { // Prevent default form submission event.preventDefault(); const task = event.currentTarget.taskInput.value.trim();
}); Finally we will use the createElement method to create a new li element and the appendChild method to add the newly created element to our task list: taskForm.addEventListener('submit', function (event) { // Prevent default form submission event.preventDefault(); const task = event.currentTarget.taskInput.value.trim(); const li = document.createElement('li'); li.textContent = task; taskList.appendChild(li); // Clear the input field event.currentTarget.taskInput.value = '';
}); When you now click the button, you will see that a new task will be added.

