As you complete the project, the Project Manager once again walks up to you and remembers that it might be a good idea to allow the user to delete tasks. So now you need to add a delete button. This means that whenever you create a new element, you need to add a delete button to it. To accomplish this we first need to create the delete button: const li = document.createElement('li');
li.textContent = task; // New code starts here const deleteButton = document.createElement('button');
deleteButton.textContent = 'Delete'; Then we need to attach an event listener to the delete button: deleteButton.addEventListener('click', function () { taskList.removeChild(li);
}); Finally we need to add the delete button to the task item: li.appendChild(deleteButton); Quite a lot of work to just add a little delete button. Additionally our code is now all over the place and not really reusable. This doesn't seem like it will scale to a larger application. To simplify our lives, we will use a library called React . The idea behind React is to create declarative UIs with nicely separated components. Basically we only define how the application should look like (hence the declarative aspect) and React takes care of the rest, such as determining the necessary DOM manipulations. As you will see soon, this is an incredibly useful feature.

176.body:
Consider our App function: function App() { return ( <div> <h1>Tasks</h1> <ul> <li>Read the Next.js book</li> <li>Write a website</li> </ul> </div> );
} While this might look like HTML, it is important to emphasize that this is emphatically not HTML. Instead this syntax is JSX, which is a syntax extension to JavaScript that can be transpiled to normal JavaScript. To be precise, the JSX will be transpiled to calls to the React.createElement function which will return regular JavaScript objects. The root object will be dynamically added to the DOM using this line of code: ReactDOM.createRoot(document.getElementById('root')!).render(<App />); The difference between JSX and HTML is not just a nitpick. For example, in JSX we can (and will) use and nest our own components exactly like we would use and nest HTML elements. Here is an example of a TaskList component rendered inside the App component: import ReactDOM from 'react-dom/client'; function App() { return <TaskList />;
} function TaskList() { return ( <div> <h1>Tasks</h1> <ul> <li>Read the Next.js book</li> <li>Write a website</li> </ul> </div> );
} ReactDOM.createRoot(document.getElementById('root')!).render(<App />); While possible, it's much more complicated (and relatively rare) to add your own custom tags in HTML. Additionally, you can include JavaScript expressions in JSX by wrapping them in curly braces {}: const x = 2;
const y = 2; function Example() { return <p>{x + y}</p>;
}

177.body:
JSX is great, but our current TaskList function is not. The main problem is that the data it represents is hardcoded into the component. Let us fix that by passing properties (props) into the component. This is simply a JavaScript object containing the data the component should render. In our case we will simply pass an array of strings named tasks containing our - well - tasks. We can then use map to create a list item li for each element of that array: type TaskListProps = { tasks: string[],
}; function TaskList(props: TaskListProps) { return ( <ul> {props.tasks.map((task) => ( <li>{task}</li> ))} </ul> );
} This is already not too bad, but of course we want to take advantage of the latest and greatest JavaScript syntax there is. Writing props.tasks is annoying. This will become even more annoying when we have a lot of props. We can use object destructuring to alleviate this: function TaskList({ tasks }: TaskListProps) { return ( <ul> {tasks.map((item) => ( <li>{item}</li> ))} </ul> );
} You can hopefully see how all the concepts from chapters 1 and 2 are coming together quite nicely. Excellent! We can use the new component like this: function App() { return ( <div> <h1>Tasks</h1> <TaskList items={['Read the Next.js book', 'Write a website']} /> </div> );
} Quite nice. Note that there is a problem with the current implementation of our component. You can see this by opening your browser console. An error "Warning: Each child in a list should have a unique 'key' prop." will appear. The reason for that is that React needs a way to identify which items in a list have changed or have been added or removed. It does that by looking at the keys of the items. These basically give the elements a stable identity. Let's add IDs to the tasks (we will need them anyway later) and use the task IDs as keys for the component: function App() { const tasks = [ { id: 'TSK-1', title: 'Read the Next.js book', }, { id: 'TSK-2', title: 'Write a website', }, ]; return ( <div> <h1>Tasks</h1> <TaskList tasks={tasks} /> </div> );
} function TaskList({ tasks }: TaskListProps) { return ( <ul> {tasks.map((item) => ( <li key={item.id}>{item.title}</li> ))} </ul> );
} There is one final improvement we can make: The div element in App is pretty useless, since it only serves the purpose of wrapping the h1 and TaskList (since a component can only return a single JSX element). Luckily, there is a special component called a React fragment which allows us to wrap multiple JSX elements without showing up in the DOM later. You can create a fragment using the <></> syntax: function App() { const tasks = [ { id: 'TSK-1', title: 'Read the Next.js book', }, { id: 'TSK-2', title: 'Write a website', }, ]; return ( <> <h1>Tasks</h1> <TaskList tasks={tasks} /> </> );
}

