We should note that it is common practice to put components into separate files (unless two components are heavily related to each other). In this example, we might put the TaskList component into a file task-list.tsx: type Task = { id: string, title: string,
}; type TaskListProps = { tasks: Task[],
}; export function TaskList({ tasks }: TaskListProps) { return ( <ul> {tasks.map((item) => ( <li key={item.id}>{item.title}</li> ))} </ul> );
} Note that we have to export the TaskList component so that we can import it in our index.tsx file: import { TaskList } from 'task-list'; function App() { const tasks = [ { id: 'TSK-1', title: 'Read the Next.js book', }, { id: 'TSK-2', title: 'Write a website', }, ]; return ( <div> <h1>Tasks</h1> <TaskList tasks={tasks} /> </div> );
} ReactDOM.createRoot(document.getElementById('root')!).render(<App />);

