You should have a big question in the back of your head right now. Why do we need to go through all this pain? Why not just use a regular variable? After all, this is how we always remembered values before. We simply assigned them to variables. Let's have a look at why this doesn't work with React: export default function Counter() { let count = 0; return ( <> <p>{count}</p> <button onClick={() => { count += 1; }} > Increment </button> </> );
} Try clicking the button know - nothing will happen. But why? The problem lies in the fact that, while we do update the local variable, React doesn't actually rerender the component to show the change. You can verify this by adding a few console.logs: export default function Counter() { let count = 0; console.log('Rendered counter component'); return ( <> <p>{count}</p> <button onClick={() => { count += 1; console.log(`New value of count is ${count}`); }} > Increment </button> </> );
} If you open the component and click the button a few times, you will see the following logs: Rendered counter component
New value of count is 1
New value of count is 2
New value of count is 3 So the local variable is indeed updated - but this doesn't rerender the component. We begin to see the purpose of the useState hook - to define a state whose updates will trigger a rerender . This explanation should have immediately raised another question. What happens if we skip the state setter function and just set the state variable directly? export default function Counter() { let [count, setCount] = React.useState(0); console.log('Rendered counter component'); return ( <> <p>{count}</p> <button onClick={() => { count += 1; console.log(`New value of count is ${count}`); }} > Increment </button> </> );
} If you click the button a few times, you will see the exact same behaviour as with the previous example: Rendered counter component
New value of count is 1
New value of count is 2
New value of count is 3 Therefore if you need to update the UI of your component, you can't use local variables and you can't update the state variables directly. You need to use the state setter function to not only update the state variable, but also to rerender the component. Let's verify that using the state setter function does what we expect: export default function Counter() { let [count, setCount] = React.useState(0); console.log(`Rendered counter component with count=${count}`); return ( <> <p>{count}</p> <button onClick={() => { setCount(count + 1); console.log(`New value of count is ${count}`); }} > Increment </button> </> );
} We will now see that the component rerenders if we click the "Increment" button: Rendered counter component with count=0
New value of count is 0
Rendered counter component with count=1 Note that the value of count only changes on the next render . Here is what happens: The component renders for the first time. Because the initial value of count is set to 0, it will render with count being equal to 0. You click the button and setCount is called with count + 1 (which will be 0 + 1, i.e. 1). React rerenders the component while remembering that the new count should be 1. The component renders for the second time. Because React remembered that count was set to 1, the component will render with count set to 1.

