A page is a UI that is unique to a route. You can also define a UI that is shared between multiple pages. This is called a layout . You define a layout be default exporting a React component from a layout file (e.g. layout.tsx). The component should accept a children prop that will be populated with a child layout or a child page. Let's go to layout.ts in the root directory, which currently looks like this: export default function RootLayout({ children }: { children: React.ReactNode }) { return ( <html lang="en"> <body>{children}</body> </html> );
} Let's change it to: export default function RootLayout({ children }: { children: React.ReactNode }) { return ( <html lang="en"> <body> <header>My header</header> {children} </body> </html> );
} Now the header "My header" will appear on every page (i.e. both on / and /about). After you verified this, you can remove the header again. Note that the top-most layout (which must always be present) is called the root layout and will be shared across all pages. The root layout must contain html and body tags. The root layout is also where you define metadata. This can be done by exporting a metadata object: export const metadata: Metadata = { title: 'Easy Opus', description: 'A task management application',
};

