Route handlers basically allow you to create API routes. Route handlers are defined by route files. Let's create a new file api/task/route.ts and add a simple example route handler: import { NextResponse } from 'next/server'; export async function GET() { return NextResponse.json({ taskId: 1, });
} Try accessing the route: $ curl localhost:3000/api/task
{"taskId":1} You can access the request by passing a request argument to the function: import { NextRequest, NextResponse } from 'next/server'; export async function GET(request: NextRequest) { console.log({ request }); return NextResponse.json({ taskId: 1, });
} If you look at your console, you will see that the request object is logged. You can use the request object to access the various request properties. For example, you could retrieve the cookies of the current request using request.cookies. This is a special RequestCookies object that exposes methods that you can use to retrieve cookies: import { NextRequest, NextResponse } from 'next/server'; export async function GET(request: NextRequest) { const cookies = request.cookies; const allCookies = cookies.getAll(); const languageCookie = cookies.get('language'); return NextResponse.json({ allCookies, languageCookie, });
} Try accessing the route now: $ curl --cookie "language=de" localhost:3000/api/task
{"allCookies":[{"name":"language","value":"de"}],"languageCookie":{"name":"language","value":"de"}} Similarly you can access the headers of a request: import { NextRequest, NextResponse } from 'next/server'; export async function GET(request: NextRequest) { const headers = request.headers; const userAgent = headers.get('user-agent'); return NextResponse.json({ headers: Array.from(headers), userAgent, });
} Try accessing the route again: $ curl localhost:3000/api/task
{"headers":[["accept","*/*"],["host","localhost:3000"],["user-agent","curl/7.81.0"],["x-forwarded-for","::ffff:127.0.0.1"],["x-forwarded-host","localhost:3000"],["x-forwarded-port","3000"],["x-forwarded-proto","http"]],"userAgent":"curl/7.81.0"} You can have dynamic segments in your route handlers: import { NextResponse } from 'next/server'; export async function GET(request: Request, { params }: { params: { id: string } }) { const id = params.id; return NextResponse.json({ taskId: id, });
} You can read query params from the nextUrl.searchParams object: import { NextResponse, type NextRequest } from 'next/server'; export function GET(request: NextRequest) { const searchParams = request.nextUrl.searchParams; const title = searchParams.get('title'); return NextResponse.json({ title, });
} For example: $ curl "localhost:3000/api/task?title=Title&description=Description"
{"title":"Title"}

