Client components are components that are rendered both on the server and on the client. You use client components when you need interactivity or you need to use certain browser APIs. You can opt into client components with "use client". Consider the following component: import * as React from 'react'; export default function Counter() { const [count, setCount] = React.useState(0); return ( <div> <p>{count}</p> <button onClick={() => setCount(count + 1)}>+</button> </div> );
} If you try to go to the corresponding page, you will see an error: Error: useState only works in Client Components. Add the "use client" directive at the top of the file to use it. Read more: https://nextjs.org/docs/messages/react-client-hook-in-server-component This is because you can't use useState on the server since you can't store client state there. To fix the error, we need to add the "use client" directive: 'use client'; import * as React from 'react'; export default function Counter() { const [count, setCount] = React.useState(0); return ( <div> <p>{count}</p> <button onClick={() => setCount(count + 1)}>+</button> </div> );
} You can verify that this component is rendered both on the server and the client by adding a console.log: 'use client'; import * as React from 'react'; export default function Counter() { const [count, setCount] = React.useState(0); console.log('Rendered counter'); return ( <div> <p>{count}</p> <button onClick={() => setCount(count + 1)}>+</button> </div> );
} If you go to http://localhost:3000/counter, you will see that the message is output both on the server as well as the client. If you click the button, you will see that the message is output only on the client (since the component only rerenders there). However, if you refresh the page, you will observe that the message is again logged both to the server as well as the client.

