Let's say you are writing a task application ( just how did I come up with that example? ) and you need to store a bunch of tasks. You could of course declare a separate variable for every task like this: const task1 = 'First task';
const task2 = 'Second task';
const task3 = 'Third task'; However this would quickly become very tedious . In addition you may want to add or delete tasks. Adding and deleting variables will become even more tedious . It would become almost as tedious as repeating the word tedious over and over. Did we mention that this is really tedious ? As you can see, we need a way to store multiple values in a single variable. A JavaScript array is an ordered collection of multiple values. You can declare an array using an array literal (also called an array initializer in this context): const tasks = ['First task', 'Second task', 'Third task']; Note that an array is no longer a primitive type, instead arrays have the type object: console.log(typeof tasks); // object You can access individual elements of an array using the index notation. This works by writing the name of the array, followed by the position of the element you want to retrieve inside square brackets. Note that when we count the indices (positions), we start at 0, not at 1: console.log(tasks[0]); // First task
console.log(tasks[1]); // Second task If the array index is too big, trying to access the element at that index will return undefined: console.log(tasks[3]); // undefined You can get the length of an array by using .length: console.log(tasks.length); // 3 Note that even despite the fact the tasks array is declared as a constant here, you can still change the contents of the array. However you can't reassign tasks to something else, i.e. you can't write something like tasks = [1]. JavaScript has some elegant syntax for working with arrays. If you want to assign variables based on values of an array, you would normally have to do something like this: const firstTask = tasks[0];
const secondTask = tasks[1];
const thirdTask = tasks[2]; This is (you guessed it) tedious . Instead you can use the array destructuring assignment : const [firstTask, secondTask, thirdTask] = tasks;
console.log(secondTask); // Second task If you only care about some of the elements, you can use the spread (...) syntax: const [firstTask, ...otherTasks] = tasks; Something that commonly trips up beginners is trying to copy an array. Let's say you have an array of numbers called arr and you want to create a copy called arr2. You would probably try something like const arr = [1, 2, 3, 4];
const arr2 = arr; This is wrong . Let's try changing the first element of arr and look at arr[0] and arr2[0]: arr[0] = 5;
console.log(arr[0]); // 5
console.log(arr2[0]); // 5 Uh-oh! That's probably not what we want. The reason for this behaviour is that arr and arr2 both point to the same array. Remember how we were careful to introduce a variable as a storage location together with a symbolic name ? Well, it turns out that different symbolic names may refer to the exact same storage location . You can visualize it like this: Here we have a storage location containing the values 1, 2, 3 and 4 somewhere. We also have two symbolic names arr and arr2. While the symbolic names are different, they point to the same storage location. Therefore if we change the storage location, we will observe a change via both symbolic names. In order to actually copy the values, we can in fact use the spread syntax as this will copy the values: const copied = [...arr]; Let's check that this indeed an actual copy: arr[0] = 5;
console.log(arr[0]); // 5
console.log(copied[0]); // 1 This looks good. Here is the mental picture you should have in your head for copying an array: If you only briefly skimmed the section on array destructuring and the spread syntax, go right back and read it carefully. These two concepts will come up a lot in the following chapters (much more often than you think right now).

