Let's return to our (yet) imaginary task application. A task will probably be something more than just a string. For example it might contain an ID, a title and a description. We could again store these in constants: const taskId = 1;
const taskTitle = 'Read the Next.js book';
const taskDescription = 'Read and understand the Next.js book.'; As you can probably guess, this will quickly become tedious (oh no, not this again). Objects to the rescue! These allow us to store name-value pairs inside a single variable. Here is how we might create a task object that contains all the information we want to know about a task: const task = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}; Every such value is called a property . We can access properties using the dot notation or the square bracket notation. For example to access the title property of the task object, you would write task.title or task['title']. Try it out: console.log(task.id); // 1
console.log(task.title); // Read the Next.js book
console.log(task.description); // Read and understand the Next.js book.
console.log(task['id']); // 1
console.log(task['title']); // Read the Next.js book
console.log(task['description']); // Read and understand the Next.js book. Note that we will practically always use the dot notation. Properties don't have to be primitive values. They can also be other objects. Generally speaking, you can arbitrarily nest objects and arrays. For example, here is how you can nest an object inside an object: const person = { name: 'John Doe', task: { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.', },
}; You can access the title property of the person.task object like this: console.log(person.task.title); // Read the Next.js book If you try to access a property that doesn't exist, the result will be undefined (there it is again): console.log(task.date); // undefined Sometimes you want to explicitly indicate that a property may be absent. For example a person may not have a task assigned to them. You could do something like this: const person = { name: 'John Doe', task: undefined,
}; This has the potential problem that someone referring to person.task will have no idea whether it is undefined, because the property is not supposed to exist at all or because it is explicitly undefined. There is nothing that prevents you from using undefined to denote absence all the time and in fact we will do so in this very book. Just keep in mind that null exists and that some developers use it to indicate absence (and that it's totally fine to do so). Remember how we said that there is one more primitive data type left? Well - there it is. The final primitive data type is null. This is something a lot of people are really confused about, because typeof null returns object (and not e.g. null). However this is primarily a technical detail. Despite the fact that null is a separate data type it doesn't hurt to think of it as an object (namely an absent one). Just as with arrays, you can use destructuring assignment when working with objects: const task = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
};
const { id, title, description } = task; And just like with arrays, you can use the spread syntax: const taskWithAssignee = { assignee: 'Max', ...task,
};
console.log(taskWithAssignee); This will print: { "assignee": "Max", "id": 1, "title": "Read the Next.js book", "description": "Read and understand the Next.js book."
} Note that objects are more than just containers for values. We will talk about this in the section on functions.

