The ternary operator takes a condition , an expression to execute if the condition is truthy and an expression to execute if the condition is falsy . It looks like this: const doneMsg = 'All tasks are done';
const notDoneMsg = 'There are tasks left';
const msg = done ? doneMsg : notDoneMsg; The general form is: condition ? expression1 : expression2; You can think of the ternary operator as a short, compact way to write an if ... else statement. It evaluates a condition, and if that condition is true (truthy), the result will have the value of the first expression. If the condition is false (falsy), the result will have the value of the second expression. There is a very common thing beginning programmers do with ternary operators which looks like this: const finished = tasks.length === 0 ? true : false; You should stop for a second and think about why this is unnecessary. Thought about it? That's right - the expression tasks.length === 0 already evaluates to a boolean value. You can just write const finished = tasks.length === 0;

