Consider the following task object: const nextTask = { title: 'Read the Next.js book', description: 'Read and understand the Next.js book', date: { day: 8, month: 6, year: 2022, },
}; Let's say we want to access the day of the task. We can do this by using nextTask.date.day. But what if the day does not have to be present, i.e. is optional ? This could happen, for example, because the user didn't enter a task. The object could look like this: const nextTask = { title: 'Read the Next.js book', description: 'Read and understand the Next.js book',
}; // or like this if you were to use `null`
const nextTask = { title: 'Read the Next.js book', description: 'Read and understand the Next.js book', date: null,
}; Then nextTask.date.day will fail with Uncaught TypeError: Cannot read properties of undefined (reading 'day') This makes sense since nextTask.date will result in undefined and you can't access a property on undefined. But let's say we would like to access the day and set it to undefined if the date property is not present. Then we would need to do something like the following: const day = nextTask.date !== undefined ? nextTask.date.day : undefined; Here is what this line does: If nextTask.date is defined, then nextTask.date.day is assigned to day. If nextTask.date is not defined, the undefined is assigned to day. Alternatively we could make use of && and write: const day = nextTask.date && nextTask.date.day; This is correct because of the way the && works. If the first expression is false (or falsy) then && doesn't look at the second expression and immediately returns the value of the first expression. If the first expression is true (or truthy) then && returns the second expression. Generally consider an object that has a bunch of values that may be absent (i.e. null or undefined). Working with such values will be annoying and only grow more cumbersome with deeper nesting. To avoid all this JavaScript allows you to do optional chaining . This works by writing ?. instead of . when trying to work on something that may be undefined. The above line would then become: const day = nextTask.date?.day; Now the result will be undefined instead of giving you a TypeError.

