We now introduce the three most important higher-order functions - map, reduce and filter. These functions allow you to perform an incredibly rich set of operations on arrays. We want to use this blockquote to emphasize how often you will be using map, reduce and filter. We will use two running examples throughout the section - an array of numbers and an array of tasks: const numbers = [1, 2, 3, 4];
const tasks = [ { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.', timeLogged: 60, status: 'In progress', }, { id: 2, title: 'Write a task app', description: 'Write an awesome task app.', timeLogged: 0, status: 'Todo', }, { id: 3, title: 'Think of a funny joke', description: 'Come up with a funny joke to lighten the mood.', timeLogged: 120, status: 'In progress', },
]; The map function takes one argument - a function f to apply to every element of the array. It returns the array resulting from applying f to every element of the original array. Let's say we wanted to square all the elements of numbers. We could write something like this: const result = [];
for (const number of numbers) { result.push(number ** 2);
} This is ugly and (you guessed it) tedious . Instead we can (and should) use the map function: const result = numbers.map((number) => number ** 2); The result array has the following content: [1, 4, 9, 16]; Consider another example. Let's say we wanted to add a long description to all the tasks based on the title and the description. We can use the map function again: const longTasks = tasks.map((task) => ({ ...task, longDescription: `${task.title}: ${task.description}`,
})); You can see why the spread syntax is so handy. Thanks to this incredible innovation , you only need to explicitly specify the object parts where something interesting happens. The longTasks array will look like this: [ { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.', timeLogged: 60, status: 'In progress', longDescription: 'Read the Next.js book: Read and understand the Next.js book.', }, { id: 2, title: 'Write a task app', description: 'Write an awesome task app.', timeLogged: 0, status: 'Todo', longDescription: 'Write a task app: Write an awesome task app.', }, { id: 3, title: 'Think of a funny joke', description: 'Come up with a funny joke to lighten the mood.', timeLogged: 120, status: 'In progress', longDescription: 'Think of a funny joke: Come up with a funny joke to lighten the mood.', },
]; The filter function allows you to select elements from an array based on some condition. It takes a function f which returns true or false for some input(s). All elements for which f returns true are kept, all elements for which f returns false are thrown away. A function which returns true or false is commonly referred to as a predicate . For example let's say we want to select all even elements from numbers. Here is the non-functional way: const result = [];
for (const number in numbers) { if (number % 2 === 0) { result.push(number ** 2); }
} Ugh! I don't even want to look at that. For loops and if statements all over the place. Let's rest our eyes and consider the functional approach: const result = numbers.filter((number) => number % 2 === 0); Consider another example - we might want to select all tasks from the tasks array which have the status 'Todo'. Think for a moment what the appropriate predicate would be. That's right, it looks like this: const todoTasks = tasks.filter((task) => task.status === 'Todo'); Finally there is the reduce function which (you guessed it) reduces an array to a single value. The reduce function moves over an array from left to right and keeps track of a value (a so called accumulator ). At every element of the array it recomputes the accumulator based on a function f (this function f is the first argument of the reduce function). The second argument of the reduce function is the initial value. Here is how we might compute the sum of an array: const sum = numbers.reduce((acc, curr) => acc + curr, 0); Basically this is what happens: The reduce function looks at acc (which is the initial value, i.e. 0 at the beginning) and curr (which is 1), produces acc + curr, and sets this as the new accumulator (i.e. the new accumulator is 1). Next the reduce function again looks at acc (which is now 1) and curr (which is 2), produces acc + curr, and sets this as the new accumulator (i.e. the new accumulator is 3). The next update results in the accumulator being 6 and the final update result in the accumulator being 10. Therefore sum will be 10. For another example, let's say we would like to compute the total logged time (i.e. the time logged for all the tasks combined). This would look like this: const totalTime = tasks.reduce((curr, task) => task.timeLogged + curr, 0); We recommend that you try to reason through this reduce for a deeper understanding of this topic. Note that unlike map and filter, you should use reduce sparingly as it's very easy to write convoluted code with reduce.

