The response object is not terribly useful by itself. Let's retrieve the "actual" response which is a JSON object. Here is how the JSON we get from https://jsonplaceholder.typicode.com/todos/1 looks like: { "userId": 1, "id": 1, "title": "delectus aut autem", "completed": false
} The response object has a json method to retrieve the JSON contained in a response. However, the json method is also asynchronous, so we are again dealing with promises. Your first instinct might be to write something like this: const url = 'https://jsonplaceholder.typicode.com/todos/1';
const fetchPromise = fetch(url);
const jsonPromise = fetchPromise.then((response) => { const jsonPromise = response.json(); jsonPromise.then((json) => console.log(json));
}); This is technically not wrong, but it's ugly. Basically every time we need to add an asynchronous operation to our code that depends on the result of a previous asynchronous operation, we would need to add one level of nesting which will quickly become unreadable. Luckily for us, the benevolent god-emperors of JavaScript have eliminated this problem by making then return a promise that "resolves" to the result of the handler function. Therefore instead of nesting promises, we can chain promises: const url = 'https://jsonplaceholder.typicode.com/todos/1';
const fetchPromise = fetch(url);
const jsonPromise = fetchPromise.then((response) => response.json());
jsonPromise.then((json) => console.log(json)); This is (quite appropriately) called promise chaining . Here is what happens, when we call this code: The fetch method immediately returns a pending promise fetchPromise. The then method of fetchPromise attaches the handler function (response) => response.json() to the fetchPromise and also immediately returns. This time the return value is the pending promise jsonPromise. The then method of jsonPromise attaches the handler function (json) => console.log(json) and also immediately returns another pending promise (which we ignore here). The network request initiated by fetch finishes and fetchPromise is fulfilled (with a Response object as its fulfillment value). Now that fetchPromise is fulfilled the handler function (response) => response.json() is kicked off and attempts to parse the response as a JSON object. At some point the JSON parsing is finished and jsonPromise is fulfilled. Now that jsonPromise is fulfilled the handler function (json) => console.log(json) is kicked off and the JSON object is logged to the console. You can basically think of a chain as being executed in two stages. In the first stage the promises are set up and the handler functions are attached using the then method. This stage happens immediately. In the second stage the promises are settled and the attached handler functions are actually executed. This stage can take quite some time, depending on how long the tasks we want to accomplish take. This explanation is the most important part of this entire section. You should pause and think about this promise chain for a second (or maybe even multiple seconds). If you understand this point, you (mostly) understand asynchronous programming. Note that we can rewrite our promise chain to be a bit more elegant: const url = 'https://jsonplaceholder.typicode.com/todos/1';
fetch(url) .then((response) => response.json()) .then((json) => console.log(json));

