fetch(url) .then((response) => { if (!response.ok) { throw new Error(`Request failed with status ${response.status}`); } return response.json(); }) .then((json) => console.log(json)); We want to be able to catch all the errors that can happen and log an error message to the console. The Promise API gives us the appropriately named catch method to accomplish this. We simply add a catch handler to the end of our promise chain - it will be called when any of the asynchronous operations fail: const url = 'https://jsonplaceholder.typicode.com/todos/1';
