The ultimate number one tip for writing better code is as obvious in theory, as it is complicated in practice: Your variables and functions should have sensible names that describe their purpose. Consider this simple example: function f(a, s) { const r = []; for (const i of a) { if (i.st === s) { r.push(i.su); } } return r;
} Well, this code clearly sucks. It's absolutely unreadable and the unreadability is solely down to really terrible variable names. Let's rewrite it: function getTaskTitlesByStatus(tasks, status) { const taskTitles = []; for (const task of tasks) { if (task.status === status) { taskTitles.push(task.title); } } return taskTitles;
} And suddenly the purpose of the code is clear as day. The function getTaskTitlesByStatus gets all the titles of the tasks that have a certain status. And we know that, because it is literally in the name of the function! Not only does the function have a good name (which is important when trying to use this function), but so do the variables (which is important when we need to fix possible mistakes in this function). Of course, this is a very extreme example (on purpose), but it's really incredible how often programmers give terrible names to functions and variables. This happens even to developers that should know better. We will note, that naming things is usually not as easy as in this example. There are many legitime cases where giving something a good name is not trivial, but you should at least always try to have sensible names. The poor soul that will have to fix your bugs, will really thank you for that.

