Most of the time a function is not as simple as getTaskTitlesByStatus, which often leads to many lines of complex code that is hard to understand. A common practice for such cases is this: Extract code from complicated functions into helper functions and then call the helper functions . Consider a function that takes an array of tasks and returns an array of generated notifications to be shown to the user. The notifications are generated for urgent tasks (i.e. tasks where the deadline is in the next two days). Additionally, generate a notification with the number of uncompleted tasks. You might write the function like this: function generateNotifications(tasks) { const urgentTasks = []; let uncompletedTaskCount = 0; tasks.forEach((task) => { const today = new Date(); const twoDaysLater = new Date(today.getFullYear(), today.getMonth(), today.getDate() + 2); if (task.deadline <= twoDaysLater) { urgentTasks.push(task); } if (task.status === 'todo' || task.status === 'inprogress') { uncompletedTaskCount++; } }); const notifications = []; if (urgentTasks.length > 0) { notifications.push( `You have ${urgentTasks.length} urgent tasks. Here they are: ${urgentTasks}.`, ); } if (uncompletedTaskCount > 0) { notifications.push(`You have ${uncompletedTaskCount} uncompleted tasks.`); } return notifications;
} Try to read this function and understand it. This probably takes some time, especially if you are a beginner who is not used to digesting large chunks of code quickly. We can massively improve this code by splitting the function into small helper functions: function findUrgentTasks(tasks) { const urgentTasks = []; const today = new Date(); const twoDaysLater = new Date(today.getFullYear(), today.getMonth(), today.getDate() + 2); tasks.forEach((task) => { if (task.deadline <= twoDaysLater) { urgentTasks.push(task); } }); return urgentTasks;
} function countUncompletedTasks(tasks) { let uncompletedTaskCount = 0; tasks.forEach((task) => { if (task.status === 'todo' || task.status === 'inprogress') { uncompletedTaskCount++; } }); return uncompletedTaskCount;
} function generateNotifications(tasks) { const urgentTasks = findUrgentTasks(tasks); const uncompletedTaskCount = countUncompletedTasks(tasks); const notifications = []; if (urgentTasks.length > 0) { notifications.push( `You have ${urgentTasks.length} urgent tasks. Here they are: ${urgentTasks}.`, ); } if (uncompletedTaskCount > 0) { notifications.push(`You have ${uncompletedTaskCount} uncompleted tasks.`); } return notifications;
} The generateNotification function is now much simpler to read. Instead of a multiple potentially complex calculations, it contains functions where each function is responsible for exactly one complex calculation. Note that the loops didn't really change, but they now do isolated things inside helper functions with sensible names. For example the for loop that calculates the uncompletedTaskCount is now isolated inside the countUncompletedTasks function and therefore its purpose is immediately clear - even before you've read the actual loop.

