The object type syntax we just introduced is often quite verbose. This is why TypeScript gives you the possibility to specify a type alias (i.e. another name) for an object type: type Task = { id: number; title: string; description: string;
}; Note that you can specify type aliases for more than just object types since type aliases are basically just different names for types. For example we could specify a type alias for the primitive type string: type ID = string; Another important point to make about type aliases is that two type aliases are exactly the same as long as the underlying types are the same. For example this is valid even though it doesn't look like it: type MyString = string; function getMyString(): MyString { return 'My string';
} const s: string = getMyString(); This is because TypeScript uses a structural type system - it doesn't matter what the types are named (except for the primitive types of course), it only matters how their structure looks like.
